\begin{align*}
4u-5v &= 23 \\
2u+4v &= -8
\end{align*}

Multiplying the second equation by 1 (for simplicity), we get:

\begin{align*}
4u-5v &= 23 \\
2u+4v &= -8 \\
2u+4v+5v &= -8+5v \\
6u+9v &= -2
\end{align*}

Now, we can solve for $v$:

\begin{align*}
6u+9v &= -2 \\
9v &= -2-6u \\
v &= \frac{-2-6u}{9}
\end{align*}

Substituting $v$ into the first equation, we get:

