To solve the system of equations \begin{align*}
xy &= 6 - 2x - 3y,\\
yz &= 6 - 4y - 2z,\\
xz &= 30 - 4x - 3z,
\end{align*} we first apply Simon's Favorite Factoring Trick to each equation. Rearranging the equations, we get \begin{align*}
xy + 2x + 3y &= 6,\\
yz + 4y + 2z &= 6,\\
xz + 4x + 3z &= 30.
\end{align*}

Adding $6$, $8$, and $12$ to both sides of each equation, respectively, we obtain \begin{align*}
xy + 2x + 3y + 6 = (x+3)(y+2),\\
yz + 4y + 2z + 8 = (y+2)(z+2),\\
xz + 4x + 3z + 12 = (x+3)(z+3).
\end{align*}

From these equations, we can deduce that $(x+3)(y+2)(z+3)=12\times14\times36=10368$.

To find the positive solution of $x$, we first solve for $z$ in terms of $x$ from the third equation: $z=\dfrac{30-4x}{3}$. Substituting this expression for $z$ into the first equation, we have \begin{align*}
xy &= 6 - 2x - 3\left(\dfrac{30-4x}{3}\right)\\
&= 6 - 2x - 10 + \dfrac{4x}{3}.
\end{align*}

Simplifying this equation, we get $xy+\dfrac{4x}{3}=5$.

To find the positive solution of $x$, we can substitute $y=\dfrac{3}{2}$ into this equation and solve for $x$: \begin{align*}
x\left(\dfrac{3}{2}\right)+\dfrac{4x}{3} = 5.
\end{align*}

Multiplying both sides by $\dfrac{3}{2}$, we have \begin{align*}
x+\dfrac{4x}{3\cdot\dfrac{3}{2}} = \dfrac{5\cdot\dfrac{3}{2}}{3\cdot\dfrac{3}{2}}.
\end{align*}

Simplifying, we get $x+\dfrac{4x}{3}=\dfrac{5}{2}$. Solving for $x$, we find $x=\dfrac{7}{3}$.

Thus, the positive solution of $x$ is $\boxed{\dfrac{7}{3}}$. Final Answer: $\dfrac{7}{3}$

