To find the time it takes for the ball to hit the ground, we need to find the root of the quadratic equation given by $h = -16t^2 - 24t + 160$.

First, we complete the square:

\begin{align*}
h & = -16(t^2 + \frac{1}{4}t^2) - 24t + 160\\
& = -16(t^2 + \frac{1}{4}t^2 + \frac{1}{16}t^2) - 24t + 160 + \frac{1}{16}t^2\\
& = -16(t^2 + \frac{1}{4}t^2 + \frac{1}{16}t^2 + \frac{1}{16}t^2) - 24t + 160 + \frac{1}{16}t^2\\
& = -16(t + \frac{1}{2})^2 - 24t + 161
\end{align*}

Next, we take the square root of both sides and solve for $t$:

\begin{align*}
\sqrt{-16(t + \frac{1}{2})^2 - 24t + 161} & = 0\\
-16(t + \frac{1}{2})^2 - 24t + 161 & \ge 0
\end{align*}

Let $u = t + \frac{1}{2}$. We have:

\begin{align*}
-16u^2 - 24(u-\frac{1}{2}) + 161 & \ge 0\\
-16u^2 - 24u + 22 & \ge 0
\end{align*}

Dividing both sides by $-16$:

\begin{align*}
u^2 + \frac{u}{2} - \frac{1}{4} & \le \frac{1}{2}\\
(u-\frac{1}{4})^2 & \le \frac{1}{16}
\end{align*}

Taking the square root of both sides:

\begin{align*}
|u-\frac{1}{4}| & \le \frac{1}{4}\\
|t + \frac{1}{2} - \frac{1}{4}| & \le \frac{1}{4}\\
|t + \frac{3}{4}| & \le \frac{1}{4}\\
t & \ge -\frac{3}{4}\\
t & \approx 1.75
\end{align*}

So, the ball hits the ground approximately 1.75 seconds after being thrown.

Final Answer: 1.75.

