6j^2 - 4j + 12 &= 6\left(j^2 - \frac{2}{3} j + \frac{1}{9}\right) + 12 - \frac{6}{9} \\
&= 6\left(j - \frac{1}{3} \right)^2 + \frac{34}{3}
\end{align}

